import React from 'react';
import Header from './components/Header';

function App() {
  return (
    <div>
      <h1>Movie App</h1>
      <Header title="Inception" description="A mind-bending thriller" />
      <Header title="Interstellar" description="An epic space adventure" />
    </div>
  );
}

export default App;
